s($,"acJ","Gc",function(){return H.a([T.y5("World\u2019s largest gambling hub in China reopens for business', description: 'Macau, located on the south coast of China has started issuing tourist visas again. Casino operators have been losing $15m (\xa311.5m) daily in expenses as the city became a ghost town after the Covid-19 pandemic struck. Macau's economy is heavily reliant on the tourism and gaming industry, which shrank 49% in the first quarter of this year.","3123","2020-08-12 10:54:37","BBC","World\u2019s largest gambling hub in China reopens for business","https://www.bbc.com/news/business-53747270","https://res.cloudinary.com/news-snap/image/upload/c_fit,h_450,q_auto:good,w_600/v1/Article/Images/keenan-constance-VTLcvV6UVaI-unsplash_1597244077"),T.y5("Fishermen around Mauritius fished out dead eel from the oily waters of the Indian Ocean after a Japanese ship caused an oil spill on a Mauritian shore. The spill has pushed off two decades of restoring the natural wildlife and plants in the lagoon, in vain. The Japanese bulk carrier leaked about  1,000 tonnes of oil in the clear Mauritian waters.","3120","2020-08-12 10:46:29","Reuters","Sea life around Mauritius dying due to enormous oil spill","https://www.reuters.com/article/us-mauritius-environment/sea-life-around-mauritius-dying-as-japanese-ship-oil-spill-spreads-idUSKCN25722I","https://res.cloudinary.com/news-snap/image/upload/c_fit,h_450,q_auto:good,w_600/v1/Article/Images/lance-anderson-4jVFRtYPIT0-unsplash_1597243589"),T.y5("A team working with the U.K.\u2019s MET office compared today\u2019s Arctic scenario with that of the interglacial period and showed that the Arctic sea ice is melting rapidly. The evidence indicates that the Arctic could see a complete loss of sea ice within 15 years. A simulation of the future using the same model showed the ice-free Arctic by 2035.","3118","2020-08-12 10:40:32","Independent","Scientists says all the Arctic sea ice could melt by 2035","https://www.independent.co.uk/environment/arctic-sea-ice-melt-2035-met-office-climate-change-a9665046.html","https://res.cloudinary.com/news-snap/image/upload/c_fit,h_450,q_auto:good,w_600/v1/Article/Images/roxanne-desgagnes-qbtyUQtqJ8k-unsplash_1597243232"),T.y5("The Spring League is going to use a bubble concept that would be the first of its kind in football for its six-team football tournament scheduled in Las Vegas in October. For this concept, a total of 228 players, 38 per team will stay, practice and play at the same hotel. The league's bubble schedule calls for 10 days of practice starting Oct 7th. ","3111","2020-08-12 09:53:13","ESPN","American football league will be first to use bubble concept","https://www.espn.in/nfl/story/_/id/29638025/spring-league-become-first-utilize-bubble-concept-football-six-team-october-tournament-las-vegas","https://res.cloudinary.com/news-snap/image/upload/c_fit,h_450,q_auto:good,w_600/v1/Article/Images/soccer-blur-o17iJ1k1DHI-unsplash_1597240392"),T.y5("A new study shows that an organic diet can reduce levels of 'glyphosate', the main part of the widely used weedkiller by 70% in 6 days. Glyphosate is linked with high rates of kidney disease in farming communities and shortened pregnancy in the midwest. This summer the E.U. announced plans to transform 25% of agriculture to organic by 2030.","3109","2020-08-12 09:17:30","The Guardian","Organic diet can help reduce pesticides in your body by 70%","https://www.theguardian.com/environment/commentisfree/2020/aug/11/pesticide-danger-organic-food-roundup-study","https://res.cloudinary.com/news-snap/image/upload/c_fit,h_450,q_auto:good,w_600/v1/Article/Images/etienne-girardet-_Fp3YZ7lt-Y-unsplash_1597238249")],H.a1("n<y4*>"))})
